    for (let i = 0; i < str.length; i++) {
        if (charSet.has(str[i])) {
            return false;
        }
        charSet.add(str[i]);
    }
    return true;
}

function isUnique(str: string): boolean {
    let charSet = new Set();

    for (let i = 0; i < str.length; i++) {
        if (charSet.has(str[i])) {
            return false;
        }
        charSet.add(str[i]);
    }
    return true;
}
